    // IMG to SVG
    function jetix_svg() {
        jQuery('img').each(function () {
            var jQueryimg = jQuery(this);
            var imgClass = jQueryimg.attr('class');
            var imgURL = jQueryimg.attr('src');
            jQuery.get(imgURL, function (data) {
                // Get the SVG tag, ignore the rest
                var jQuerysvg = jQuery(data).find('svg');

                // Add replaced image's classes to the new SVG
                if (typeof imgClass !== 'undefined') {
                    jQuerysvg = jQuerysvg.attr('class', imgClass + ' replaced-svg');
                }
                jQuerysvg = jQuerysvg.removeAttr('xmlns:a');
                // Replace image with new SVG
                jQueryimg.replaceWith(jQuerysvg);

            }, 'xml');

        });
    }
    $(document).each(function () {
        jetix_svg();
    })

    
    // Search results
    var posts = [],
        searchKey = $('#searchInput'),
        searchContent = $('#result'),
        searchResultnum = $('.result-counting')
    // search-bar
    $('.search').on('click', function (e) {
        e.preventDefault()

            e.stopPropagation()
            searchContent.delay(4000)
            .fadeIn()
            searchKey.focus()


        if (posts.length == 0 && typeof serachContentApi !== undefined) {
            $.get(serachContentApi)
                .done(function(data) {
                    posts = data.posts
                    console.log(posts)
                    search()
                })
                .fail(function(err) {})
        }
    });

    function search(){
        var options = {
            shouldSort: true,
            tokenize: true,
            matchAllTokens: true,
            threshold: 0,
            location: 0,
            distance: 100,
            maxPatternLength: 32,
            minMatchCharLength: 1,
            keys: [{
              name: 'title',
              weight: 0.3
            }, {
              name: 'author',
              weight: 0.7
            }]
          };
          var fuse = new Fuse(posts, options)
          
        searchKey.keyup(function(){
            var value = this.value,
            search = fuse.search(value),
            output = '',
            language = $('html').attr('lang')
            console.log(search)
            searchResultnum.addClass('d-block')
            searchResultnum.children('span').html(search.length)
            if(posts.length > 0){
                $.each(search, function(key, val) {
                    var pubDate = new Date(
                        val.published_at
                    ).toLocaleDateString(language, {
                        day: 'numeric',
                        month: 'long',
                        year: 'numeric',
                    })
                    output += `<li>
                            <h4 class="title"><a href="${val.url}">${val.title}</a></h4>
                            <p class="excerpt">${val.excerpt}</p>
                        </li>`
                })

                searchContent.html(output)
            }    
        })
    }

    //  click on close icon input text clear
    function seacrhEvent() {
        $('body').removeClass('body-overflow')
        searchKey.val('')
        searchContent.empty()
        searchResultnum.removeClass('d-block')
        $('.search-result-container').removeClass('active')
    }
    $('.bar-dismiss').on('click', function () {
        seacrhEvent()
    });
    $(document).on('click', function () {
        seacrhEvent()
    });
    $(document).keydown(function (event) {
        if (event.keyCode == 27) {
            seacrhEvent()
        }
    })



    // Copy link
    $('.copy-link').on('click', function(e){
        e.preventDefault()
        var url = $(this).data('link')

        var $temp = $("<input>");
        $("body").append($temp);
        $temp.val(url).select();
        document.execCommand("copy");
        $temp.remove();
        $('.copied').fadeIn()

        setTimeout(function(){
            $('.copied').fadeOut()
        }, 1000)
    })
